INSERT INTO `v1_daebfa074d3205dad0a112b9bb127768b360f769d5dc7c3805a77def5edd382f` VALUES (12300152, 7, 5, 1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 2, 1, 3, 4.19, 9, 3001, 0, "vo_minigame_1012_result_1084");
INSERT INTO `v1_daebfa074d3205dad0a112b9bb127768b360f769d5dc7c3805a77def5edd382f` VALUES (12300153, 1, 5, 1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 2, 1, 3, 0.0, 9, 3001, 0, "vo_minigame_1012_result_1085");
