INSERT INTO `v1_daebfa074d3205dad0a112b9bb127768b360f769d5dc7c3805a77def5edd382f` VALUES (12300155, 3, 1, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 2, 1, 1, 5.53, 4, 3001, 0, "vo_minigame_1012_result_1087");
