INSERT INTO `v1_daebfa074d3205dad0a112b9bb127768b360f769d5dc7c3805a77def5edd382f` VALUES (12300161, 3, 1, 3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 2, 1, 3, 0.0, 4, 3001, 0, "vo_minigame_1012_result_1093");
